import IInfos from "../../../types";


export default function Item(
    {Model, Licenseplate, Entrada} : IInfos,
    { setSelecionado }: any
    ){
    return(
    <li onClick={ () => {
        // on click, updates the selecionado with the actual object (IInfos) and change Selecionado to true
        props.setSelecionado()
    
    }}>
        {Model + ' | '}
        { Licenseplate + ' | '}<br />
        {Entrada}
    </li>
    )


}
